package main

import "strings"
import "fmt"
import "math"

var input = `



`

/*var input = `ULL
RRDDD
LURDL
UUUUD`*/

func coord2Code(x, y int) string {
	grid := [][]string{
		[]string{"0", "0", "1", "0", "0"},
		[]string{"0", "2", "3", "4", "0"},
		[]string{"5", "6", "7", "8", "9"},
		[]string{"0", "A", "B", "C", "0"},
		[]string{"0", "0", "D", "0", "0"},
	}
	return grid[x+2][y+2]
}

func move(direction string, x int, y int) (int, int) {
	var outX, outY int
	switch direction {
	case "U":
		outX = x - 1
		outY = y
	case "L":
		outX = x
		outY = y - 1
	case "R":
		outX = x
		outY = y + 1
	case "D":
		outX = x + 1
		outY = y
	default:
		outX = x
		outY = y
	}
	if math.Abs(float64(outX))+math.Abs(float64(outY)) > 2 {
		outX = x
		outY = y
	}
	return outX, outY
}

func main() {
	code := []string{}
	curX := 0
	curY := -2
	for _, s := range strings.Split(input, "\n") {
		for _, dir := range s {
			curX, curY = move(string(dir), curX, curY)
		}
		code = append(code, coord2Code(curX, curY))
	}
	for _, c := range code {
		fmt.Println(c)
	}
}
